Brief Description:
Brazilian based foodtech hub creating and supplying animal-free ingredients and solutions to b2b companies since 2008. Four different business units:
1 - Jewery of Ingredients: Distribution of specialties from all over the world to brazilian industries;
2 - Ancient Balance: Creation and Production of special ingredients from ancient and tradicional grains, pulses and beans from south american biodiversity;
3 - Combinativity facility: Combination of special ingredients with creativity in adding value and defenses for b2b customers;
4 - Carnevale: Texturization of vegetable proteins both dry and wet.
